function Calcolatore(props) {
  const prezzoTHC = props.prezzoTHC;
  return (
    <div>
      <div className="resultLabel">
        <div
          style={{minWidth: 300}}
          className="mainLayout column flexSpace marginTop30 maxWidth350"
        >
          <div className="input" style={{width: 250, maxWidth: "none"}}>
